        public static async Task SaveAsync(
            WriteableBitmap writeableBitmap,
            StorageFile outputFile)
        {
            var encoderId = BitmapEncoder.PngEncoderId;

            Stream stream = writeableBitmap.PixelBuffer.AsStream();
            byte[] pixels = new byte[(uint)stream.Length];
            await stream.ReadAsync(pixels, 0, pixels.Length);

            using (var writeStream = await outputFile.OpenAsync(FileAccessMode.ReadWrite))
            {
                var encoder = await BitmapEncoder.CreateAsync(encoderId, writeStream);
                encoder.SetPixelData(
                    BitmapPixelFormat.Bgra8,
                    BitmapAlphaMode.Premultiplied,
                    (uint)writeableBitmap.PixelWidth,
                    (uint)writeableBitmap.PixelHeight,
                    96,
                    96,
                    pixels);

                await encoder.FlushAsync();

                using (var outputStream = writeStream.GetOutputStreamAt(0))
                {
                    await outputStream.FlushAsync();
                }
            }
        }

        public static async Task<byte[]> SaveAsync(
            WriteableBitmap writeableBitmap)
        {
            byte[] bytes = null;
            var encoderId = BitmapEncoder.PngEncoderId;

            using (Stream stream = writeableBitmap.PixelBuffer.AsStream())
            {
                byte[] pixels = new byte[(uint) stream.Length];
                await stream.ReadAsync(pixels, 0, pixels.Length);
                using (InMemoryRandomAccessStream writeStream =
                    new InMemoryRandomAccessStream())
                {
                    var encoder = await BitmapEncoder.CreateAsync(encoderId, writeStream);
                    encoder.SetPixelData(
                        BitmapPixelFormat.Bgra8,
                        BitmapAlphaMode.Premultiplied,
                        (uint) writeableBitmap.PixelWidth,
                        (uint) writeableBitmap.PixelHeight,
                        96,
                        96,
                        pixels);

                    await encoder.FlushAsync();

                    using (var outputStream = writeStream.GetOutputStreamAt(0))
                    {
                        await outputStream.FlushAsync();
                    }

                    using (var s = writeStream.AsStream())
                    {
                        bytes = new byte[(int) s.Length];
                        await s.ReadAsync(bytes, 0, (int) s.Length);
                    }
                }
            }
            return bytes;
        }

